import { useState } from "react";
import { useNavigate, Link } from "react-router-dom";

function Login() {
  const navigate = useNavigate();
  const [form, setForm] = useState({ username: "", password: "" });
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleLogin = async () => {
    setError("");
    if (!form.username.trim() || !form.password.trim()) {
      setError("Please enter both username and password.");
      return;
    }

    setLoading(true);
    try {
      // Simulate API call delay
      await new Promise((r) => setTimeout(r, 1000));

      // Simulate successful login & token setting
      const fakeToken = "your.jwt.token";
      localStorage.setItem("token", fakeToken);

      navigate("/home");
    } catch (err) {
      setError("Login failed. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card} role="main" aria-label="Login form">
        <h2 style={styles.title}>Doctor Login</h2>

        <label htmlFor="username" style={styles.label}>
          Username
        </label>
        <input
          id="username"
          name="username"
          type="text"
          placeholder="Enter your username"
          value={form.username}
          onChange={handleChange}
          style={styles.input}
          autoComplete="username"
          disabled={loading}
          aria-required="true"
        />

        <label htmlFor="password" style={styles.label}>
          Password
        </label>
        <input
          id="password"
          name="password"
          type="password"
          placeholder="Enter your password"
          value={form.password}
          onChange={handleChange}
          style={styles.input}
          autoComplete="current-password"
          disabled={loading}
          aria-required="true"
        />

        {error && <p style={styles.error}>{error}</p>}

        <button
          onClick={handleLogin}
          style={{ ...styles.button, ...(loading ? styles.buttonDisabled : {}) }}
          disabled={loading}
          aria-busy={loading}
        >
          {loading ? "Logging in..." : "Login as Doctor"}
        </button>

        <p style={styles.registerText}>
          Don't have an account?{" "}
          <Link to="/register" style={styles.registerLink}>
            Register here
          </Link>
        </p>
      </div>
    </div>
  );
}

const styles = {
  container: {
    height: "100vh",
    background:
      "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    padding: "20px",
  },
  card: {
    backgroundColor: "white",
    padding: "40px 50px",
    borderRadius: "12px",
    boxShadow: "0 8px 20px rgba(0,0,0,0.15)",
    width: "360px",
    maxWidth: "100%",
    textAlign: "left",
  },
  title: {
    marginBottom: "24px",
    color: "#333",
    textAlign: "center",
    fontWeight: "700",
  },
  label: {
    display: "block",
    marginBottom: "6px",
    fontWeight: "600",
    color: "#555",
  },
  input: {
    width: "100%",
    padding: "12px 15px",
    marginBottom: "20px",
    borderRadius: "8px",
    border: "1px solid #ccc",
    fontSize: "16px",
    outline: "none",
    transition: "border-color 0.3s",
    boxSizing: "border-box",
  },
  error: {
    color: "#e74c3c",
    marginBottom: "20px",
    fontWeight: "600",
    fontSize: "14px",
  },
  button: {
    width: "100%",
    padding: "12px 15px",
    backgroundColor: "#667eea",
    color: "white",
    fontWeight: "600",
    fontSize: "16px",
    borderRadius: "8px",
    border: "none",
    cursor: "pointer",
    transition: "background-color 0.3s",
  },
  buttonDisabled: {
    backgroundColor: "#a2a6f4",
    cursor: "not-allowed",
  },
  registerText: {
    marginTop: "16px",
    fontSize: "14px",
    textAlign: "center",
    color: "#555",
  },
  registerLink: {
    color: "#667eea",
    fontWeight: "600",
    textDecoration: "none",
  },
};

export default Login;
